import React from 'react';
import Header from '../components/shared/Header';
import BaseLayout from '../components/layouts/BaseLayout';

class Index extends React.Component {
  constructor() {}

  componentDidMount() {}

  render() {
    return (
      <BaseLayout>
        <h1>Home Page</h1>
      </BaseLayout>
    );
  }
}

export default Index;
